<h2 class="card-title m-3">
  <h1 class="text-center">SEO Tracking (Coming soon)</h1>
</h2>
<q-table [rows]="filterSummaryRankingRows" [tableColumnDescriptors]="summaryColumnDescriptors" [compact]="true"
  [pageSize]="100000">
  <tr *tableRowTemplate="let row;">
    <td>
      {{row?.ranking}}
    </td>
    <td>
      {{row?.count}}
    </td>
    <td>
      {{row?.trend}}
    </td>
  </tr>
</q-table>
